import React from 'react'
import { Navigate } from 'react-router-dom'
import Navbar from './navbar/navbar'

const Dashboard = () => {

  const token = localStorage.getItem('tokenAdmin')

  if(!token){
    return <Navigate to='/'/>
  }

  return (
    <div style={{backgroundColor: 'gray'}}>
      <Navbar/>
    </div>
  )
}

export default Dashboard
